%%
sx = 64;
sy = 128;
step = 8;

scale_step = 0.8;
levels = 5;

scale = 1.0;

dets = [];
scores = [];
labels = {};

for k=1:levels %[output:group:1a38f6d8]

scale %[output:92d319bc] %[output:8c71b7a1] %[output:5f8a4d1e] %[output:8f710af8] %[output:0d2dc219]
cur_img = imresize(It, scale);

w = size(cur_img, 2);
h = size(cur_img, 1);

count_x = floor((w - sx) / step) %[output:5bae8d0f] %[output:912782b7] %[output:4451e176] %[output:91c0fdca] %[output:57e7c7fb]
count_y = floor((h - sy) / step) %[output:5c873037] %[output:75f35699] %[output:9497334e] %[output:1f58d1e8] %[output:4d90b768]

out = zeros(count_y, count_x);

for j=0:count_y-1
    for i=0:count_x-1
        x = 1+(i*step);
        y = 1+(j*step);
        sub_img = cur_img(y:y+sy, x:x+sx);
        sub_hog = extractHOGFeatures(sub_img);
        % klasyfikator
        % If this is the first run, train the SVM classifier
        global svm_model
        if ~exist('svm_model', 'var') || isempty(svm_model)
            % Load positive examples
            pos_dir = 'pos';
            pos_files = dir(fullfile(pos_dir, '*.png'));
            neg_dir = 'neg_64';
            neg_files = dir(fullfile(neg_dir, '*.png'));
            
            % Extract HOG features from first image to determine feature size
            sample_img_p = imread(fullfile(pos_dir, pos_files(1).name));
            sample_features = extractHOGFeatures(sample_img_p);
            feature_length = length(sample_features);
            
            % Preallocate array for positive features
            pos_features = zeros(length(pos_files), feature_length);
            pos_features(1,:) = sample_features;
            
            % Process remaining positive examples
            for p = 2:length(pos_files)
                img_p = imread(fullfile(pos_dir, pos_files(p).name));
                img_p = imresize(img_p, [sy, sx]);
                pos_features(p,:) = extractHOGFeatures(img_p);
            end
            
            % Load negative examples
            % Preallocate array for negative features
            neg_features = zeros(length(neg_files), feature_length);
            
            for n = 1:length(neg_files)
                img_n = imread(fullfile(neg_dir, neg_files(n).name));
                img_n = imresize(img_n, [sy, sx]);
                neg_features(n,:) = extractHOGFeatures(img_n);
            end
            
            % Prepare training data
            X = [pos_features; neg_features];
            Y = [ones(size(pos_features, 1), 1); -ones(size(neg_features, 1), 1)];
            
            % Train SVM model
            svm_model = fitcsvm(X, Y, 'KernelFunction', 'linear', 'Standardize', true, ...
                'KernelScale','auto');
        end

        % Classify the current window
        [label, score] = predict(svm_model, sub_hog);
        % disp(score)
        out(j+1, i+1) = -score(2);
    end
end

